import React, { useState, useMemo } from 'react';
import {
  Box,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  Tooltip,
  Rating,
  IconButton,
  TextField,
  InputAdornment,
  Chip,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  useTheme,
  alpha
} from '@mui/material';
import { Search as SearchIcon, FilterList as FilterIcon } from '@mui/icons-material';
import { useUsers } from './UserContext';
import { User, Skill, UserSkill } from '../types/User';

// Sample skills data (in a real app, this would come from an API or database)
const sampleSkills: Skill[] = [
  { id: 'js', name: 'JavaScript', category: 'Programming' },
  { id: 'react', name: 'React', category: 'Programming' },
  { id: 'node', name: 'Node.js', category: 'Programming' },
  { id: 'python', name: 'Python', category: 'Programming' },
  { id: 'java', name: 'Java', category: 'Programming' },
  { id: 'agile', name: 'Agile', category: 'Methodology' },
  { id: 'scrum', name: 'Scrum', category: 'Methodology' },
  { id: 'pm', name: 'Project Management', category: 'Management' },
];

const SkillsMatrix: React.FC = () => {
  const theme = useTheme();
  const { users } = useUsers();
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState<string>('');

  // Get unique categories from skills
  const categories = useMemo(() => {
    return Array.from(new Set(sampleSkills.map(skill => skill.category)));
  }, []);

  // Filter skills based on search and category
  const filteredSkills = useMemo(() => {
    return sampleSkills.filter(skill => {
      const matchesSearch = skill.name.toLowerCase().includes(searchTerm.toLowerCase());
      const matchesCategory = !selectedCategory || skill.category === selectedCategory;
      return matchesSearch && matchesCategory;
    });
  }, [searchTerm, selectedCategory]);

  // Get filtered users based on search
  const filteredUsers = useMemo(() => {
    return users.filter(user =>
      user.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
  }, [users, searchTerm]);

  const getSkillLevel = (user: User, skillId: string): number => {
    return user.skills?.find(s => s.skillId === skillId)?.level || 0;
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>Skills Matrix</Typography>

      {/* Filters */}
      <Box sx={{ mb: 3, display: 'flex', gap: 2, alignItems: 'center' }}>
        <TextField
          placeholder="Search skills or users..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          sx={{ width: 300 }}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon />
              </InputAdornment>
            ),
          }}
        />

        <FormControl sx={{ minWidth: 200 }}>
          <InputLabel>Category</InputLabel>
          <Select
            value={selectedCategory}
            onChange={(e) => setSelectedCategory(e.target.value)}
            label="Category"
          >
            <MenuItem value="">All Categories</MenuItem>
            {categories.map(category => (
              <MenuItem key={category} value={category}>{category}</MenuItem>
            ))}
          </Select>
        </FormControl>
      </Box>

      {/* Matrix Table */}
      <TableContainer component={Paper} variant="outlined">
        <Table sx={{ minWidth: 650 }} size="small">
          <TableHead>
            <TableRow>
              <TableCell 
                sx={{ 
                  bgcolor: theme.palette.background.default,
                  position: 'sticky',
                  left: 0,
                  zIndex: 2,
                  minWidth: 200
                }}
              >
                User / Skill
              </TableCell>
              {filteredSkills.map(skill => (
                <TableCell 
                  key={skill.id}
                  align="center"
                  sx={{ 
                    minWidth: 120,
                    bgcolor: theme.palette.background.default
                  }}
                >
                  <Tooltip title={`Category: ${skill.category}`} arrow>
                    <Typography variant="subtitle2" sx={{ whiteSpace: 'nowrap' }}>
                      {skill.name}
                    </Typography>
                  </Tooltip>
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {filteredUsers.map(user => (
              <TableRow key={user.id}>
                <TableCell 
                  component="th" 
                  scope="row"
                  sx={{ 
                    bgcolor: theme.palette.background.paper,
                    position: 'sticky',
                    left: 0,
                    zIndex: 1
                  }}
                >
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <Typography>{user.name}</Typography>
                    <Chip 
                      label={user.team} 
                      size="small" 
                      sx={{ 
                        bgcolor: alpha(theme.palette.primary.main, 0.1),
                        color: theme.palette.primary.main
                      }}
                    />
                  </Box>
                </TableCell>
                {filteredSkills.map(skill => (
                  <TableCell key={skill.id} align="center">
                    <Tooltip 
                      title={getSkillLevel(user, skill.id) > 0 ? 
                        `Experience: ${user.skills?.find(s => s.skillId === skill.id)?.yearsOfExperience} years` : 
                        'No experience'
                      } 
                      arrow
                    >
                      <Box>
                        <Rating
                          value={getSkillLevel(user, skill.id)}
                          readOnly
                          max={5}
                          size="small"
                        />
                      </Box>
                    </Tooltip>
                  </TableCell>
                ))}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default SkillsMatrix;
